-- Name: cleanup_old_config_history(); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cleanup_old_config_history() RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    v_deleted_count INTEGER;
BEGIN
    DELETE FROM system_config_history 
    WHERE created_at < NOW() - INTERVAL '6 months'
        AND severity NOT IN ('error', 'critical');
    
    GET DIAGNOSTICS v_deleted_count = ROW_COUNT;
    
    RETURN v_deleted_count;
END;
$$;


--
-- TOC entry 301 (class 1255 OID 44390)
-- Name: cleanup_old_config_logs(integer); Type: FUNCTION; Schema: public; Owner: -
--

CREATE FUNCTION public.cleanup_old_config_logs(days_to_keep integer DEFAULT 30) RETURNS integer
    LANGUAGE plpgsql
    AS $$
DECLARE
    deleted_count INTEGER;
BEGIN
    DELETE FROM config_change_logs 
    WHERE created_at < CURRENT_TIMESTAMP - INTERVAL '1 day' * days_to_keep;
    
    GET DIAGNOSTICS deleted_count = ROW_COUNT;
    
    -- 同时清理已处理的通知记录
    DELETE FROM config_change_notifications 
    WHERE status = 'sent' 
      AND created_at < CURRENT_TIMESTAMP - INTERVAL '1 day' * (days_to_keep / 2);
    
    RETURN deleted_count;
END;
$$;


