--
-- TOC entry 260 (class 1259 OID 44428)
-- Name: config_change_history; Type: VIEW; Schema: public; Owner: -
--

CREATE VIEW public.config_change_history AS
 SELECT ccl.id,
    ccl.table_name,
    ccl.record_id,
    ccl.action,
    ccl.changed_fields,
    ccl.created_at,
    ccl.change_reason,
        CASE ccl.table_name
            WHEN 'tron_networks'::text THEN 'TRON网络配置'::character varying
            WHEN 'telegram_bots'::text THEN 'Telegram机器人配置'::character varying
            WHEN 'bot_network_configs'::text THEN '机器人网络关联配置'::character varying
            WHEN 'system_configs'::text THEN '系统配置'::character varying
            ELSE ccl.table_name
        END AS table_display_name,
        CASE ccl.table_name
            WHEN 'tron_networks'::text THEN (ccl.new_data ->> 'name'::text)
            WHEN 'telegram_bots'::text THEN (ccl.new_data ->> 'bot_name'::text)
            ELSE (ccl.record_id)::text
        END AS record_name
   FROM public.config_change_logs ccl
  ORDER BY ccl.created_at DESC;


